import React from 'react';
import { View, StyleSheet, Text } from 'react-native';

export const PlayScreen = () => {
    return (
        <View style={styles.center}>
            <Text>PlayScreen</Text>
        </View>
    );
};

const styles = StyleSheet.create({
    center: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
});
